const Rubik300 = `@font-face { font-family: 'Rubik'; font-style: normal; font-weight: 300; src: local('Rubik Light'), local('Rubik-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const Rubik300italic = `@font-face { font-family: 'Rubik'; font-style: italic; font-weight: 300; src: local('Rubik Light Italic'), local('Rubik-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const RubikRegular = `@font-face { font-family: 'Rubik'; font-style: normal; font-weight: 400; src: local('Rubik'), local('Rubik-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const RubikItalic = `@font-face { font-family: 'Rubik'; font-style: italic; font-weight: 400; src: local('Rubik Italic'), local('Rubik-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
